create table Ornek (
	id INT  not null primary key,
	first_name VARCHAR(50) not null,
	last_name VARCHAR(50),
	email VARCHAR(50),
	Gander VARCHAR(50),
	Country_0f_Birty VARCHAR(50),
	Salary INT,
	City VARCHAR(50),
	Status VARCHAR(50)
);


 
 



select * from Ornek;

/* hangi ülkeden kaç kiþi var */
select Country_0f_Birty, count(*) from Ornek group by Country_0f_Birty order by Country_0f_Birty;

/* cinsiyete göre kaç kiþi var */
select gander, count(*) from Ornek group by gander order by gander;
select gander, count(*) from Ornek group by gander;
 
 
 /* hangi ülkeler var */
 select distinct Country_0f_Birty from Ornek order by Country_0f_Birty;
 select distinct Country_0f_Birty from Ornek;
 
 /* China dan erkek kimler var */
 select * from Ornek where Gander='Male' and Country_0f_Birty='China'; 
 
 
 /* china dan 2000 ile 5000 arasý maas alanlar  */
 select * from ornek where Country_0f_Birty='China'  and (salary between 2000 and 5000);
 

/* sadece maaslarý gösterir */
select salary from ornek order by salary;
select salary from ornek order by salary  offset 2 row;  // ilk 2 yi atlýyor sonrasýný gösteriyor

select salary from ornek order by salary  fetch next 5 row only;   // ilk 5i gösteriyor
 
select salary from ornek order by salary  offset 5 row fetch next 10 row only;   /// ilk 5 atlar sonraki 10 u gösteriyor

Limit 5 ----  5 satýrla sýnýrla
top 5   ---   en yuksek 5 i verir

select  * from ornek limit top 5;
select * from ornek where rownum <=5;    // ilk 5 i verir

/* maasýn %10 unu gösterir  */ 
select first_name,salary, salary*0.10 as Tax from ornek; 

select first_name,salary from Ornek where salary>15
union
select first_name,salary from satislarimiz where satis_fiyati>90;


